import pandas as pddef load_data() -> dict:        dict_input = {}        # Load dataset from Google Drive (public link)    url = 'https://drive.google.com/file/d/1oUKeGWhluIJlRlc94LOfUM6skf5lDnA5/view?usp=share_link'        dict_input['Data'] = pd.read_csv(        'https://drive.google.com/uc?export=download&id='+url.split('/')[-2]        ).dropna()        return dict_input